		["Kingsbane Damage"] = {
			["outline"] = "OUTLINE",
			["disjunctive"] = "any",
			["displayText"] = "%c",
			["customText"] = "function()\n    if WeakAuras.IsOptionsOpen() then return \"1.23m\" end   \n    if aura_env.expires then\n        if GetTime() >= aura_env.expires then\n            aura_env.active = nil\n            aura_env.expires = nil\n            aura_env.totalDamage = 0\n            return \"\"\n        else\n            return aura_env.shortenNumber(aura_env.totalDamage)\n        end\n    elseif aura_env.active then\n        return aura_env.shortenNumber(aura_env.totalDamage)\n    else \n        return \"\"\n    end    \nend",
			["untrigger"] = {
			},
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = -10,
			["customTextUpdate"] = "update",
			["automaticWidth"] = "Auto",
			["actions"] = {
				["start"] = {
					["do_sound"] = false,
				},
				["finish"] = {
					["do_sound"] = false,
				},
				["init"] = {
					["custom"] = "aura_env.kings  = 192759\naura_env.active = nil\naura_env.linger = 3\naura_env.totalDamage = 0\naura_env.addDamage = function(damage)\n    aura_env.totalDamage = aura_env.totalDamage + damage \nend\naura_env.shortenNumber = function(number)\n    local affixes = {\n        \"\",\n        \"k\",\n        \"m\",\n        \"b\",\n    }\n    \n    local affix = 1\n    local dec = 0\n    local num1 = math.abs(number)\n    while num1 >= 1000 and affix < #affixes do\n        num1 = num1 / 1000\n        affix = affix + 1\n    end\n    if affix > 1 then\n        dec = 2\n        local num2 = num1\n        while num2 >= 10 do\n            num2 = num2 / 10\n            dec = dec - 1\n        end\n    end\n    if number < 0 then\n        num1 = -num1\n    end\n    \n    return string.format(\"%.\"..dec..\"f\"..affixes[affix], num1)\nend\n\n\n\n\n\n\n\n\n\n",
					["do_custom"] = true,
				},
			},
			["selfPoint"] = "BOTTOM",
			["trigger"] = {
				["type"] = "custom",
				["custom_type"] = "event",
				["event"] = "Health",
				["unit"] = "player",
				["custom_hide"] = "timed",
				["custom"] = "function(e, ...)\n    local t = select(2, ...)\n    local s = select(4, ...)\n    local d = select(8, ...)\n    local sp = select(12, ...)\n    local dmg = select(15, ...)\n    if t == \"SPELL_AURA_APPLIED\" and s == UnitGUID(\"player\") and d ~= UnitGUID(\"player\") and sp == aura_env.kings then\n        aura_env.active = true\n        aura_env.expires = nil\n    elseif t == \"SPELL_PERIODIC_DAMAGE\" and s == UnitGUID(\"player\") and sp == aura_env.kings then\n        if aura_env.active then\n            aura_env.addDamage(dmg)\n        end\n    elseif t == \"SPELL_AURA_REMOVED\" and s == UnitGUID(\"player\") and sp == aura_env.kings then\n        aura_env.expires = GetTime() + aura_env.linger\n    end  \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
