			["additional_triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom"] = "function()\n    \n    local time = GetTime()\n    \n    local currentRage = UnitPower(\"player\", 1)\n    \n    local _, _, _, _, _, _, buffExpireTime, _, _, _, buffSpellID = UnitBuff(\"player\", GetSpellInfo(202573))\n    local hasVengeanceRev = buffSpellID == 202573\n    local vengeanceRevRemaining = 0\n    if hasVengeanceRev then\n        vengeanceRevRemaining = buffExpireTime - time\n    end\n    \n    local _, _, _, _, _, _, buffExpireTime, _, _, _, buffSpellID = UnitBuff(\"player\", GetSpellInfo(202574))\n    local hasVengeanceIP = buffSpellID == 202574\n    local vengeanceIPRemaining = 0\n    if hasVengeanceIP then\n        vengeanceIPRemaining = buffExpireTime - time\n    end\n    \n    local _, spellDuration = GetSpellCooldown(6572)\n    local _, gcdDuration = GetSpellCooldown(61304)\n    local isRevOnCD = spellDuration > gcdDuration\n    \n    local isRevFree = GetSpellPowerCost(6572)[1].cost == 0\n    \n    if hasVengeanceRev and not isRevFree then\n        aura_env.text = vengeanceRevRemaining\n    elseif hasVengeanceIP then\n        aura_env.text = vengeanceIPRemaining\n    else\n        aura_env.text = false\n    end\n    \n    local revGlowing, revActive, revDarkened, ipGlowing, ipActive, ipDarkened = 1, 2, 3, 4, 5, 6\n    \n    function determineState()\n        \n        local state = nil\n        \n        if (isRevFree and not hasVengeanceIP) or (hasVengeanceRev and currentRage >= 59 and not isRevFree) or (not hasVengeanceRev and not hasVengeanceIP and currentRage >= 30 and not isRevFree) then\n            state = revGlowing\n            \n        elseif hasVengeanceRev and currentRage < 59 and currentRage >= 20 and not isRevFree then\n            state = revActive\n            \n        elseif hasVengeanceRev and currentRage < 20 and not isRevFree then\n            state = revDarkened\n            \n        elseif (hasVengeanceIP and currentRage >= 39) or (not hasVengeanceIP and not hasVengeanceRev and currentRage < 30 and currentRage >= 20 and not isRevFree) then\n            state = ipGlowing\n            \n        elseif hasVengeanceIP and currentRage < 39 and currentRage >= 13 then\n            state = ipActive\n            \n        elseif (hasVengeanceIP and currentRage < 13) or (not hasVengeanceIP and not hasVengeanceRev and currentRage < 20 and not isRevFree) then\n            state = ipDarkened\n        end\n        \n        if isRevOnCD and (state == revGlowing or state == revActive or state == revDarkened) then\n            return revDarkened\n        else\n            return state\n        end\n        \n    end\n    \n    function handleState()\n        \n        if aura_env.frameSkip then\n            aura_env.frameSkip = false\n            do return end\n        end\n        \n        local currentState = determineState()\n        \n        if aura_env.visualState == currentState then\n            do return end\n        end\n        \n        if currentState == revGlowing then\n            WeakAuras.regions[aura_env.id].region.icon:SetTexture(GetSpellTexture(6572))\n            WeakAuras.regions[aura_env.id].region.icon:SetVertexColor(1, 1, 1, 1)\n            ActionButton_ShowOverlayGlow(WeakAuras.regions[aura_env.id].region)\n            \n        elseif currentState == revActive then\n            WeakAuras.regions[aura_env.id].region.icon:SetTexture(GetSpellTexture(6572))\n            WeakAuras.regions[aura_env.id].region.icon:SetVertexColor(1, 1, 1, 1)\n            ActionButton_HideOverlayGlow(WeakAuras.regions[aura_env.id].region)\n            \n        elseif currentState == revDarkened then\n            WeakAuras.regions[aura_env.id].region.icon:SetTexture(GetSpellTexture(6572))\n            WeakAuras.regions[aura_env.id].region.icon:SetVertexColor(0.35, 0.35, 0.35, 1)\n            ActionButton_HideOverlayGlow(WeakAuras.regions[aura_env.id].region)\n            \n        elseif currentState == ipGlowing then\n            WeakAuras.regions[aura_env.id].region.icon:SetTexture(GetSpellTexture(190456))\n            WeakAuras.regions[aura_env.id].region.icon:SetVertexColor(1, 1, 1, 1)\n            ActionButton_ShowOverlayGlow(WeakAuras.regions[aura_env.id].region)\n            \n        elseif currentState == ipActive then\n            WeakAuras.regions[aura_env.id].region.icon:SetTexture(GetSpellTexture(190456))\n            WeakAuras.regions[aura_env.id].region.icon:SetVertexColor(1, 1, 1, 1)\n            ActionButton_HideOverlayGlow(WeakAuras.regions[aura_env.id].region)\n            \n        elseif currentState == ipDarkened then\n            WeakAuras.regions[aura_env.id].region.icon:SetTexture(GetSpellTexture(190456))\n            WeakAuras.regions[aura_env.id].region.icon:SetVertexColor(0.35, 0.35, 0.35, 1)\n            ActionButton_HideOverlayGlow(WeakAuras.regions[aura_env.id].region)\n        end\n        \n        aura_env.visualState = currentState\n    end\n    \n    handleState()\n    \n    return true\nend",
