				["custom"] = "function(event, ...)\n    -- mannualy put here your aura ID\n    aura_env.mySpellAuraID = 1943\n    -- put here base duratuion of your aura\n    local baseDuration = 24 \n    -----------------------------\n    \n    --here are our tables for all aura targets\n    aura_env.Target = aura_env.Target or {GUID = {}, est = {}}\n    aura_env.T_index = aura_env.T_index or 0\n    aura_env.T_num = aura_env.T_num or 0\n    aura_env.delete = false            --its time to clear all tables\n    \n    local type, _, sGUID, _, _, _, tGUID = select(2, ...)\n    local SpellID = select(12, ...)\n    \n    -- if the aura applied by you and if it is the aura we tracking\n    if sGUID == UnitGUID('player') and SpellID == aura_env.mySpellAuraID\n    then\n        \n        -- if the aura is applied\n        if type == 'SPELL_AURA_APPLIED'\n        then\n            -- and if everything is ok we put new target to our table\n            aura_env.T_index = aura_env.T_index + 1\n            aura_env.T_num = aura_env.T_num + 1\n            aura_env.Target.GUID[aura_env.T_index] = tGUID\n            aura_env.Target.est[aura_env.T_index] = baseDuration + GetTime()\n            \n            --   print('app:',aura_env.T_index, aura_env.Target.GUID[aura_env.T_index], aura_env.Target.est[aura_env.T_index])\n            -- if the aura is removed\n        elseif type == 'SPELL_AURA_REMOVED'\n        then\n            --lets look for the target our aura removed and nil everything about it\n            for k,v in pairs (aura_env.Target.GUID) do\n                if v and v == tGUID\n                then\n                    aura_env.T_num = aura_env.T_num - 1\n                    aura_env.Target.GUID[k] = nil\n                    aura_env.Target.est[k] = nil\n                    -- if we removed all our auras, lets clear the tables\n                    if aura_env.T_num == 0\n                    then\n                        aura_env.delete = true\n                    end\n                    \n                    --     print('rem:', k, aura_env.Target.GUID[k], aura_env.Target.est[k])\n                end\n            end\n            \n            -- if the aura is refreshed\n        elseif type == 'SPELL_AURA_REFRESH'\n        then\n            --lets look for the target our aura refreshed and update timer info\n            for k,v in pairs (aura_env.Target.GUID) do\n                if v and v == tGUID\n                then\n                    aura_env.Target.est[k] = baseDuration*1.3 + GetTime()\n                    \n                    --     print('ref:', k, aura_env.Target.GUID[k], aura_env.Target.est[k])\n                end\n            end\n        end  \n    end\n    \n    --so in that trigger we work with applie/refresh/remove events to create and delete targets in the table\n    return true\nend\n\n\n--by Afreg--",
